import { Form, InputGroup, ListGroup, } from "react-bootstrap";

export default function Todo({ todo: { id, name, checked }, checkTodo }) {

  function handleCheck() {
    checkTodo(id)
  }

  return (
    <InputGroup>
      <InputGroup.Checkbox onChange={handleCheck} />
      <InputGroup.Text className="" variant={checked ? "info" : "secondary"}>
        {name}
      </InputGroup.Text>
    </InputGroup>
  )
}
